import { AllMOVIS ,MovieApi } from "../types/MoviesType"
import axios from 'axios';

export const getallMoviess =  ()=>{

     return async()=>{

         const res = await axios.get(MovieApi);
     }

    return {type:AllMOVIS ,data:res.data.results,pages:res.data.total_pages}
}
